	var colorDefault = "#BEFBFF",
			colorLake = "#ffffff",
			scale = 1,
			width = 960,
			height = 700,
			language = "cn";

	function china () {
		return china;
	}

	var tooltipHtml = function (d) {	/* function to create html content string in tooltip div. */
		return "<h4>"+ language == "tw" ? d.tw_name : language == "en" ? d.en_name : d.name +"</h4>";
	}

	china.draw = function (id, options) {
		var rows = [];
		provincePaths.forEach(function (d) {
			if (options && d.id in options) {
				for (var k in options[d.id]) {
					d[k] = options[d.id][k];
				}
			}
			rows.push(d);
		});

		var g = d3.select(id)
			.attr("height", height)
			.attr("width", width)
			.append("g")
			.attr("transform", "scale(" + scale + ")");

		g.selectAll(".province")
		.data(rows).enter().append("path")
			.attr("class","province")
			.attr("d",function(d){ return d.d;})
			.attr("id", function (d) { return d.id; })
			.style("fill",function(d){ return color(d); })
			.on("mouseover", mouseOver).on("mouseout", mouseOut);

		function color (d) {
			var c;
			d["type"] == "lake" ? c = colorLake : c = colorDefault;
			d["color"] ? c = d["color"] : null;
			return c;
		}

		function mouseOver(d) {
			d3.select("#tooltip").transition().duration(200).style("opacity", 0.9);

			d3.select("#tooltip").html(tooltipHtml(d))
				.style("left", (d3.event.pageX) + "px")
				.style("top", (d3.event.pageY) + "px");
		}

		function mouseOut() {
			d3.select("#tooltip").transition().duration(500).style("opacity", 0);
		}

	};

	china.scale = function (x) {
		if (!arguments.length) return scale;
		scale = x;
		return china;
	}

	china.height = function (x) {
		if (!arguments.length) return height;
		height = x;
		return china;
	}

	china.width = function (x) {
		if (!arguments.length) return width;
		width = x;
		return china;
	}

	china.tooltipHtml = function (x) {
		if (!arguments.length) return tooltipHtml;
		tooltipHtml = x;
		return china;		
	}

	china.colorDefault = function (x) {
		if (!arguments.length) return colorDefault;
		colorDefault = x;
		return china;		
	}

	china.colorLake = function (x) {
		if (!arguments.length) return colorLake;
		colorLake = x;
		return china;
	}

	china.language = function (x) {
		if (!arguments.length) return language;
		x == "cn" || x == "tw" || x == "en" ? language = x : null;
		return china;
	}

	this.china = china;
